    "Population and productivity studies of black-legged kittiwakes, common murres,
    and pelagic cormorants at Cape Peirce, Alaska, summer 1988",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:02:24.649759",nt"name": "population-and-productivity-studies-of-black-legged-kittiwakes-common-murres-and-pelagic-c",nt"isopen":
    false,nt"url": null,nt"notes": "Cape Peirce, Alaska, was the site of a
    nesting seabird study from June 16 to August 20, 1988. Three species of nesting
    seabirds (Black-legged Kittiwakes, Common Murres, and Pelagic Cormorants) were monitored
    to determine population trends and productivity. This study was part of an ongoing
    monitoring program of nesting seabirds on the Togiak National Wildlife Refuge. From
    1984 onward, the assistance of volunteers has been utilized to monitor the population
    and productivity of these species. The collection of these data provide information
    needed to track fluctuations in productivity and how these fluctuations affect population
    trends. The objectives of this monitoring effort were to estimate productivity and
    populations present in monitoring plots for cliff nesting seabirds in order to detect
    and assess changes over time.",nt"license_title": "License Not Specified",nt"extras":
